import styled from "styled-components";
const Header=()=>{
    return (
        <NavBar>
        <Logo>
            Crypto tracker
        </Logo>
        </NavBar>
    )
}
export default Header;
const NavBar = styled.div`
color:transparent;
width:100%;
display:flex;
flex-direction:row;
justify-content:center;
align-items:center;
`
